CONTRACT_BIN = b''


def test_eth_estimate_gas(rpc_client, accounts):
    gas_estimate = rpc_client(
        method="eth_estimateGas",
        params=[{
            "from": accounts[0],
            "data": CONTRACT_BIN,
            "value": 1234,
        }],
    )
    assert gas_estimate == '0x16c11'
